def canJump(nums):

    dp = [False for i in range(len(nums))]
    # print(dp[0])
    # print(dp)
    dp[0] = True
    for i in range(0, len(dp)):
        # print(nums[i])
        if dp[i] == False:
            continue
        else:
            if nums[i] != 0:
                # print(nums[i])
                for i in range(i, min(len(nums), i+nums[i]+1)):
                    dp[i] = True
                # print(dp)

    return dp[-1]


